INSERT INTO `text_links` VALUES (1,'Mnt','Наиболее популярные офисные мониторы августа 2020','В технологическом плане на первое место, как и в целом на рынке, сейчас закономерно выходят 24-дюймовые аппараты','https://www.itbestsellers.ru/products/detail.php?ID=46326&sphrase_id=3426810','2020-10-20'),(2,'Mnt','Названы наиболее популярные игровые мониторы на российском рынке','В последнее время высокий интерес вызывают т.н. «вогнутые» модели мониторов','https://www.itbestsellers.ru/products/detail.php?ID=46278','2020-10-05'),(3,'Mfp','Бестселлеры российского рынка лазерных печатающих устройств','В текущем году одной из наиболее востребованных категорий печатающих устройств стали монохромные лазерные принтеры и настольные МФУ формата А4 малой и средней производительности (до 40 стр./мин)','https://www.itbestsellers.ru/products/detail.php?ID=46289','2020-10-06');
