INSERT INTO `txt_how` VALUES (1,'<p>Программирование, казалось бы, - слишком широкое понятие, чтобы предложить некий универсальный ответ для программиста любого плана. Это из разряда вопросов&nbsp;типа&nbsp;&quot;<strong>ноутбук для работы</strong>&quot;: какой именно <em><strong>&quot;работы&quot;? </strong></em>Финансовый аналитик и блоггер-текстовик - оба <em>&quot;работают&quot;. В</em>от только работа у них уж больно разная с точки зрения используемых инструментов, а, соответственно, и требований&nbsp;к ноутбуку.</p>\r\n\r\n<p>Однако, есть по одна позиция, которая верна для программирования любой направленности, на любых языках, средствах разработки и платформах, включая и облачные. И это, -&nbsp;конечно же,&nbsp;<strong>экран </strong>ноутбука.</p>\r\n\r\n<p>При работе&nbsp;с большинством IDE одновременно на экране оказываются:&nbsp;собственно, код; панель запуска (Run)&nbsp;или отладчика (Debugger), дерево объектов/классов, папка проекта с кучей файлов и проч. и проч.&nbsp;&nbsp;</p>\r\n\r\n<p><img alt=\"\" src=\"/static/marketability/ttx_img/screen1.jpg\" style=\"width:600px\" /></p>\r\n\r\n<p>Покупатели часто не отдают себе отчет в том, что Windows, по умолчанию, масштабирует изображение в зависимости от реального размера экрана, так сказать, в дюймах - пропорционально увеличивая и уменьшая. И дело тут не в разрешении экрана: оно может быть HD, оно может быть хоть 4K. По умолчанию вы получите картинку со шрифтами и всеми прочими элементами изображения примерно одного размера и на дисплее 13.3&quot; и на дисплее 15.6&quot; с одиним&nbsp;разрешением, допустим, HD (1920x1080).&nbsp;И понятно, что на 13&quot; уместиться качественно меньше. Конечно это можно настроить - но тогда все элементы будут неразборчиво мелки.</p>\r\n\r\n<div class=\"article_snipet\">\r\n<p><em>Сегодня вы можете увидеть много &quot;типичных ИТшников&quot; где-нибудь в кафе, с элегантным ноутбуком 13&quot;-14&quot;. Но надо понимать, что это скорее Life Style, нежели действительно&nbsp;полноценная работа. По настоящему эти люди пишут код, вероятно за полноценным настольным ПК, или ноутбуком полноценного размера, да поди&nbsp;еще и с подключенным внешним монитором. &quot;Выездной вариант&quot; в публичной среде может использоваться разве что для настроек, проверок, коммуникаций. Но&nbsp;вряд ли для разработки &quot;ядра&quot; продукта.</em></p>\r\n</div>\r\n\r\n<h2>Дисплеи с соотношением сторон 16:10</h2>','Ноутбук для программиста','Как выбрать лучший ноутбук для программиста. C++, C#, Python, Java, Web, HTML, JavaScript, CSS, Zero Coding. Требования, характеристики, процессор, память, дисплей.','','Nb','На какие характеристики ноутбука ориентироваться в зависимости от типа разработки, языка программирования и прочих аспектов создания Кода.');
